import {useRef} from "react";
import {useFrame} from "@react-three/fiber";

export default function Cube() {
    return (
        <mesh rotation={[1,1,0]}>
            <boxGeometry args={[1,1,1]}/>
            <meshStandardMaterial color={"#e76666"}/>
        </mesh>
    )
}
